import React from "react";
import Labrator from "../Images/Labrator.jpg";
import Pug from "../Images/Pug.jpg";
import Rot from "../Images/Rot.jpg";
import Beagle from "../Images/Beagle.jpg";
import Germanshepard from "../Images/Germanshepard.jpg";
import Golden from "../Images/Golden.jpg";
import Boxer from "../Images/Boxer.jpg";
import Greatdane from "../Images/Greatdane.jpg";
import Lhasa from "../Images/Lhasa.jpg";
import Pomerian from "../Images/Pomerian.jpg";
import Shin from "../Images/Shin.jpg";
import Siberian from "../Images/Siberian.jpg";

function Oursales() {
    return (
        <div className="row" style={{ padding: "30px" }}>
            <BreedColumn image={Labrator} name="Labrator" price="Rs. 13,000" />
            <BreedColumn image={Germanshepard} name="German Shepherd" price="Rs. 14,000" />
            <BreedColumn image={Rot} name="Rottweiler" price="Rs. 15,000" />
            <BreedColumn image={Beagle} name="Beagle" price="Rs. 19,000" />
            <BreedColumn image={Siberian} name="Siberian" price="Rs. 45,000" />
            <BreedColumn image={Pomerian} name="Pomerian" price="Rs. 7,000" />
            <BreedColumn image={Boxer} name="Boxer" price="Rs. 18,000" />
            <BreedColumn image={Golden} name="Golden Retriever" price="Rs. 24,000" />
            <BreedColumn image={Pug} name="Pug" price="Rs. 15,000" />
            <BreedColumn image={Shin} name="Shin Tzu" price="Rs. 25,000" />
            <BreedColumn image={Lhasa} name="Lhara Apso" price="Rs. 17,000" />
            <BreedColumn image={Greatdane} name="Great Dane" price="Rs. 20,000" />
        </div>
    );
}

function BreedColumn({ image, name, price }) {
    return (
        <div className="col-xxl-3 col-xl-3 col-md-4 col-sm-6 col-12" style={{ padding: "20px" }}>
            <div>
                <img src={image} alt={name} style={{ width: "100%", height: "250px", objectFit: "cover" }} />
            </div>
            <div>
                <h6 style={{ textAlign: "left", marginTop: "10px" }}>{name}</h6>
                <h6 style={{ textAlign: "left", marginTop: "10px" }}>{price}</h6>
            </div>
        </div>
    );
}

export default Oursales;
